	if (!result) {
		return 0;
	}
	g_signal_connect (object, "shown", (GCallback) _dbus_geany_dbus_document_shown, data);
	g_signal_connect (object, "before-close", (GCallback) _dbus_geany_dbus_document_before_close, data);
